		function Main()
		{
		  console.log(gameLevel); 
		  this.backgrounds = [exportRoot.bg1, exportRoot.bg2]; 
		  this.potholeLocations = [400, 450, 500, 550, 600, 650, 700]  
		  // Where biker and potholes go. 
		  this.playAreaTop = 400; 
		  this.playAreaBottom = 680;
		  this.playAreaHeight = this.playAreaBottom - this.playAreaTop;
		  this.ticks = 0; 
		  this.scrollStart = 0; 
		  scrollWarning.visible = true; 
			
		  // Add biker to scene in order. 
		
		  biker.x = 400; 
		  biker.y = this.playAreaTop + this.playAreaHeight/2; 
		  stage.addChildAt(biker, 1); 
			
		  createjs.Ticker.addEventListener("tick", this.update.bind(this));
		
		  window.onkeydown = this.keyPressed.bind(this); 
		  canvas.onmousedown = this.mousePressed.bind(this);
		  canvas.onwheel = this.wheelScrolled.bind(this); 
		  canvas.touchmove = console.log;
		  this.potholes = []; 
		}
		
		Main.prototype.makePothole = function() {
			var ph = new lib.Pothole; 
			this.potholes.push(ph); 
			ph.x = 1400; // Off Screen 
			ph.y = this.potholeLocations[getRandomInt(this.potholeLocations.length-1)]; 
			stage.addChildAt(ph, 1); 
		}
		
		Main.prototype.moveObstacles = function () {
			this.potholes.forEach(function(ph) {
				ph.x -= backgroundSpeed; 
			}); 
		}
		
		Main.prototype.addObstacles = function() {
			var baseTicks = 60; 
			var ticksToPothole = Math.floor(baseTicks - ((this.ticks-this.scrollStart)/(baseTicks))); 
			if (this.ticks % ticksToPothole === 0 && !injured && scrolled) {
				this.makePothole(); 
			}
		}
		
		Main.prototype.update = function(evt)
		{	
			this.ticks += 1; 
			if (!injured) {
			  this.moveBackgrounds(); 
			  this.addObstacles();
			  this.moveObstacles();
			  this.hitCheck(); 
			}
		}
		
		Main.prototype.moveBackgrounds = function() {
			this.backgrounds.forEach(function(elem) {
				elem.x -= backgroundSpeed;
				if (elem.x <= -3600) {
					elem.x = 3600; 
				}
			}); 
		}
		
		Main.prototype.triggerInjury = function() {
			backgroundSpeed = 0; 
			injured = true; 
			if (gameLevel === 1) {
				biker.gotoAndStop("injury"); 
				ucButton.visible = true; 
				homeButton.visible = true;
				gameLevel = 2; 
				localStorage.setItem("gameLevel", "2");
			} else if (gameLevel === 2) {
			    biker.gotoAndStop("injury_level2"); 
				ucButton2.visible = true; 
				erButton2.visible = true; 
				gameLevel = 1; 
				localStorage.setItem("gameLevel", "1");
			}
		
			buttonBacker.visible = true;
			spotlight.y = biker.y - 80; 
			spotlight.visible = true; 
		}
		
		Main.prototype.clearScreen = function() {
			biker.visible = false; 
			this.potholes.forEach(function(ph) {
				ph.visible = false; 
			}); 
		}
		
		Main.prototype.hitCheck = function() {
			var self = this; 
		
			if (!injured) {
				this.potholes.forEach( function (ph) {
					var phTop = ph.y - phHeight/2; 
					var phBot = ph.y + phHeight/2; 
					var phLeft = ph.x - phWidth/2; 
					var phRight = ph.x + phWidth/2; 
					
					if ((phLeft < biker.x && phRight > biker.x) && (biker.y < phBot && biker.y > phTop)) {
						self.triggerInjury(); 
					}
					
				}); 
			}
		}
		
		Main.prototype.wheelScrolled = function(evt) {
			this.moveBiker(evt.deltaY); 
		}
		
		Main.prototype.moveBiker = function(delta) {
			var change = -5; 
			
			console.log(delta); 
			if (delta < 0) {
				change *= -1; 
			}
			
			if (!scrolled) {
				scrolled = true; 
				scrollWarning.visible = false; 
				this.scrollStart = this.ticks;
			}
			
			if (!injured) {
				var modifier = .05; 
				var top = this.playAreaTop; 
				var bot = this.playAreaBottom; 
				biker.y = Math.min(bot, Math.max(top, biker.y += (delta*modifier)));
			}
		}
		
		Main.prototype.mousePressed = function(evt) {
		}
		
		Main.prototype.keyPressed = function(evt)
		{
		  var key = evt.which; 
		  switch(key) {
			  case(80):	
				  this.makePothole(); 
				  break; 
		  }
		}
		
		var main = new Main();
